    <header>
      <div className="container">
        <Link to="/">
          <h1>Workout Buddy</h1>
        </Link>
        {/* ch n9展示signup和login的html */}
        <nav>
          {/*ch n11 make a logout botton */}
          <div>
            <botton onClick={handleClick}>Log out</botton>
